class Fish extends React.Component {
    render() {
        const {image, name} = this.props.details;
        return <li className="menu-fish">
            <img src={image} alt={name} />
            <h3 classNmae="fish-name">
                {name}
            </h3>
        </li>
    }
}

export default Fish;
